import React from 'react';

const Contact = () => (
  <section className="contact">
    <h2>Contact Information</h2>
    <ul>
      <li>Joseph Murphy</li>
      <li>Phone: 612.723.5373</li>
      <li>Email: <a href="mailto:joe.michael.murphy@gmail.com">joe.michael.murphy@gmail.com</a></li>
      <li>Location: Hopkins, MN 55343</li>
      <li><a href="https://www.linkedin.com/in/joemurphy" target="_blank" rel="noopener noreferrer">LinkedIn Profile</a></li>
    </ul>
  </section>
);

export default Contact;
